import { useState,useEffect } from "react"
import React from 'react'
import axios from 'axios'
import { useNavigate } from "react-router-dom"

function SignUp() {

    const [users, setUsers] = useState([])
    const [email, setEmail] = useState('')
    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')

    useEffect(() => {
      
        fetchUsers();

    }, [])

    const fetchUsers  = () => {
        axios 
        .get('http://localhost:3001/register')
        .then((res) => {
            console.log(res.data)
        })
    }
    
    const handleRegister = (event) => {
        event.preventDefault()
        axios
        .post('http://localhost:3001/register', { email, username, password})
        .then( () => {
            setEmail('')
            setUsername('')
            setPassword('')
            fetchUsers()
        })
    }
    


  return (
    <div className='w-full h-screen flex'>
        <div className='w-[50%] h-[100%] bg-[#1a1a1a] text-white flex justify-center items-center'>
            <form className='text-center border rounded-lg w-[600px] h-[400px] p-9 '>
                {/* EMAIL INPUT */}
                <label>Email</label>
                <br/>
                <input className='w-[400px] rounded-xl bg-zinc-700 p-2'/>
                <br/>
                <br/>
                {/* USERNAME INPUT */}
                <label>Username</label>
                <br/>
                <input className='w-[400px] rounded-xl bg-zinc-700 p-2'/>
                <br/>
                <br/>
                {/* PASSWORD INPUT */}
                <label>Password</label>
                <br/>
                <input className='w-[400px] rounded-xl bg-zinc-700 p-2'/>
                <br/>
                <br/>
                {/* BUTTON */}
                <button className='w-[200px] h-[50px] border hover:bg-teal-900'>SIGN UP</button>
            </form>
        </div>
        <div className='w-[50%] h-[100%] flex justify-center items-center bg-teal-800'>
            <h2 className='text-3xl text-white'>SIGNUP</h2>
        </div>
    </div>
  )
}

export default SignUp
